import React from 'react'

function PageNotfound() {
    return (
        <div className="container my-5 allBody ">
            <h1 className="text-danger">Oh!! Page Not Found </h1>
            <img src="/page-not-found.jpg" alt="Page Not Found" />
        </div>
    )
}

export default PageNotfound
